/*Table structure for table `menu_category_table` */

DROP TABLE IF EXISTS `menu_category_table`;

CREATE TABLE `menu_category_table` (
  `menucategoryid` int(6) NOT NULL AUTO_INCREMENT,
  `menucategoryname` varchar(60) DEFAULT NULL,
  `imagelocation` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`menucategoryid`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

/*Data for the table `menu_category_table` */

insert  into `menu_category_table`(`menucategoryid`,`menucategoryname`,`imagelocation`) values (1,'SHORT ORDERS','images/svg/hot-dog.svg'),(2,'BURGERS and SANDWICHES','images/svg/hamburger.svg'),(3,'CAKES, PASTRIES and DESSERTS','images/svg/muffin.svg'),(4,'REFRESHMENTS','images/svg/wine.svg'),(5,'BEVERAGES','images/svg/beer.svg'),(6,'BILAO','images/svg/lemon.svg'),(7,'GOODIES','images/svg/bread-1.svg');

/*Table structure for table `menu_item_table` */

DROP TABLE IF EXISTS `menu_item_table`;

CREATE TABLE `menu_item_table` (
  `menuitemid` int(6) NOT NULL AUTO_INCREMENT,
  `menucategoryid` int(6) DEFAULT NULL,
  `menuitemname` varchar(60) DEFAULT NULL,
  `menuitemdescription` text,
  `price` double DEFAULT NULL,
  `imagelocation` varchar(300) DEFAULT NULL,
  `isavailable` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`menuitemid`),
  KEY `FK_menu_item_table` (`menucategoryid`),
  CONSTRAINT `FK_menu_item_table` FOREIGN KEY (`menucategoryid`) REFERENCES `menu_category_table` (`menucategoryid`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=169 DEFAULT CHARSET=utf8;

