/*Table structure for table `order_table` */

DROP TABLE IF EXISTS `order_table`;

CREATE TABLE `order_table` (
  `orderid` int(6) NOT NULL AUTO_INCREMENT,
  `customerid` int(6) DEFAULT NULL,
  `orderdate` datetime DEFAULT NULL,
  `datetimeofpickup` datetime DEFAULT NULL,
  `isapproved` tinyint(1) DEFAULT NULL,
  `userid` int(6) DEFAULT NULL,
  `ordertype` tinyint(1) DEFAULT NULL,
  `isseen` tinyint(1) DEFAULT '0',
  `isseenbycusomter` tinyint(1) DEFAULT '0',
  `isnew` tinyint(1) DEFAULT '0',
  `isdeleted` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`orderid`),
  KEY `qqwq` (`userid`),
  KEY `FK_order_table_from_order_table` (`customerid`),
  CONSTRAINT `FK_order_table_from_order_table` FOREIGN KEY (`customerid`) REFERENCES `customer_table` (`customerid`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `qqwq` FOREIGN KEY (`userid`) REFERENCES `user_table` (`userid`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8;

