/*Table structure for table `review_conversation_table` */

DROP TABLE IF EXISTS `review_conversation_table`;

CREATE TABLE `review_conversation_table` (
  `messageid` int(6) NOT NULL AUTO_INCREMENT,
  `reviewid` int(6) DEFAULT NULL,
  `datetime` datetime DEFAULT NULL,
  `message` text,
  `customerid` int(6) DEFAULT NULL,
  `userid` int(6) DEFAULT NULL,
  PRIMARY KEY (`messageid`),
